// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract MySmartContract {
    address public owner;
    uint256 public balance;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(
            msg.sender == owner,
            "Only contract owner can perform this operation"
        );
        _;
    }

    function deposit(uint256 amount) external onlyOwner {
        // Ensure the amount is positive
        require(amount > 0, "Amount must be greater than zero");

        // Increase the balance
        balance += amount;
    }

    function withdraw(uint256 amount) external onlyOwner {
        // Ensure the contract has sufficient balance
        assert(balance >= amount);

        // Ensure the amount is positive
        require(amount > 0, "Amount must be greater than zero");

        // Decrease the balance
        balance -= amount;
    }

    function transfer(uint256 amount, address payable recipient)
        external
        payable
        onlyOwner
    {
        // Ensure the contract has sufficient balance
        require(balance >= amount, "Insufficient funds");

        // Ensure the amount is positive
        require(amount > 0, "Amount must be greater than zero");

        // Ensure the recipient is not the owner
        require(recipient != owner, "Recipient cannot be the contract owner");

        // Ensure that the value being sent is less than or equal to the current balance of the contract
        require(msg.value <= balance, "Value sent exceeds contract balance");

        // Decrease the contract's balance
        balance -= amount;

        // Transfer the amount to the recipient
        recipient.transfer(amount);

        // Refund excess gas cost to the sender
        if (msg.value > amount) {
            payable(msg.sender).transfer(msg.value - amount);
        }
    }
}

